BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "logs" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "msg" varchar NOT NULL, "level" varchar NOT NULL, "app" varchar, "tag" varchar, "pid" integer, "tid" integer(8), "ts" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
