CREATE TABLE IF NOT EXISTS "country_codes" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "kind" varchar NOT NULL, "country_id" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "countries" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "slug" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar NOT NULL, "alt_names" varchar, "hist_names" varchar, "pop" integer NOT NULL, "area" integer NOT NULL, "continent_id" integer, "country_id" integer, "s" boolean DEFAULT 'f' NOT NULL, "c" boolean DEFAULT 'f' NOT NULL, "d" boolean DEFAULT 'f' NOT NULL, "m" boolean DEFAULT 'f' NOT NULL, "motor" varchar, "alpha2" varchar, "alpha3" varchar, "num" varchar, "fifa" varchar, "ioc" varchar, "fips" varchar, "net" varchar, "wikipedia" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "states" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "country_id" integer NOT NULL, "level" integer DEFAULT 1 NOT NULL, "pop" integer, "area" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "parts" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "level" integer DEFAULT 2 NOT NULL, "pop" integer, "area" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "counties" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "part_id" integer, "level" integer DEFAULT 2 NOT NULL, "pop" integer, "area" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "munis" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "county_id" integer, "level" integer DEFAULT 3 NOT NULL, "pop" integer, "area" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
