CREATE TABLE IF NOT EXISTS "cities" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "alt_names" varchar, "country_id" integer NOT NULL, "state_id" integer, "part_id" integer, "county_id" integer, "muni_id" integer, "metro_id" integer, "pop" integer, "area" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
